import axios from "axios";
import React from "react";
import { useEffect, useState } from "react";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";

function TrafficCam() {
	const [state, setState] = useState({});

	const token = process.env.REACT_APP_API_KEY_SLA_TOKEN;
	console.log(token);

	useEffect(() => {
		axios
			.get("https://api.data.gov.sg/v1/transport/traffic-images")
			.then((res) => {
				setState(res.data.items[0].cameras[1].image);
			});
	}, [state]);

	return (
		<div>
			<Container>
				{state && (
					<Typography variant="h3" display="block" align="center">
						<img src={state} />
					</Typography>
				)}
			</Container>
		</div>
	);
}

export default TrafficCam;
